import React, { useState } from 'react'
import s from './Content.module.css'
import WinnersBlock from './WinnersBlock/WinnersBlock';
import Data from '../../../../BLL/Winners.json'

function Content(props) {

    let Data1 = [ ];

    let [SelectedItem, SetSelectedItem] = useState(0);
    let YearsEl = Data.map(() => {})

    return (
        <div className={s.Content}>
            <div className={s.paginator}>
                <div onClick={ () => SetSelectedItem(0) } className={SelectedItem === 0 ? s.itemCoosing : s.item}><span className={s.YearName}>2021</span></div>
                <div onClick={ () => SetSelectedItem(1) } className={SelectedItem === 1 ? s.itemCoosing : s.item}><span className={s.YearName}>2020</span></div>
                <div onClick={ () => SetSelectedItem(2) } className={SelectedItem === 2 ? s.itemCoosing : s.item}><span className={s.YearName}>2019</span></div>
                <div onClick={ () => SetSelectedItem(3) } className={SelectedItem === 3 ? s.itemCoosing : s.item}><span className={s.YearName}>2018</span></div>
            </div>
            <div className={props.colaps ? s.WinsBloks1 : s.WinsBloks}>
                <div className={s.Block1}>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'R-Style Lab: Базы данных (SQL)'}/>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'ISsoft: Full-stack web development'}/>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'R-Style Lab: Базы данных (SQL)'}/>
                </div>
                <div className={s.Block2}>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'R-Style Lab: Базы данных (SQL)'}/>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'ISsoft: Full-stack web development'}/>
                    <WinnersBlock Data={Data[SelectedItem][0]} name={'R-Style Lab: Базы данных (SQL)'}/>
                </div>
            </div>
        </div>
    );
}


export default Content;
